import base64
import os
import tempfile


class Icon():
    def __init__(self):
        self.tempicon =  os.path.join(tempfile.gettempdir(),'pdfconverter.ico')
        self.iconbase64=""""""
        self.createicon()
        
    def createicon(self):
        icon = base64.b64decode(self.iconbase64)
        iconfile= open(self.tempicon,"wb")
        iconfile.write(icon)
        iconfile.close()

    def removetemp(self):
        try:
            os.remove(self.tempicon)
        except:
            pass